  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is a map of land use and vegetation
  for the Island of Maui, Hawaii, circa 2010. This dataset is a modified version of
  the U.S. Geological Survey LANDFIRE Existing Vegetation Type map (LANDFIRE.HI_110EVT,
  Refresh 2008) for the Island of Maui, Hawaii. The LANDFIRE Existing Vegetation Type
  map was modified to create this map of land use and vegetation for use in a water-budget
  model. Modifications included converting the LANDFIRE Existing Vegetation Type map
  from a raster to a shapefile format, assigning land-use names, and adding golf-course
  and crop boundaries.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
